<p>我接触python时间已经不短了，但学习中一直是零零散散，先有想法，再去学习对应的知识（比如爬虫），所以知识掌握得很不成系统。近来准备把python系统性地学一遍，于是有了此文，既作为自己学习的备忘笔记，也希望能帮助其他具有一点基础的人快速入门python。</p>
